import Link from "next/link";

const About = () => {
	return (
		<div>
			<nav>
				<Link href="/">
					<a>Home</a>
				</Link>
				<Link href="/about">
					<a>About</a>
				</Link>
			</nav>
			<h1>About BitzPrice</h1>
			<p>Aplication to view Bitcoin prices</p>
		</div>
	);
};

export default About;
